import React from "react";
import { Route, Switch } from "react-router-dom";
import Home from "./Home";

import "./App.css";
import Product from "./Product";

const App = () => (
  <Switch>
    <Route exact={true} path="/" component={Home} />
    <Route exact={true} path="/product" component={Product} />
  </Switch>
);

export default App;
